svg.script:
var lines = ["Flusso_123", "Flusso_122", "Flusso_105", "Flusso_115", "Flusso_102", "Flusso_114", "Flusso_125", "Flusso_108", "Flusso_99", "Flusso_110", "Flusso_128", "Flusso_121", "Flusso_104", "Flusso_117", "Flusso_101", "Flusso_111", "Flusso_116", "Flusso_107", "Flusso_96", "Flusso_127", "Flusso_103", "Flusso_124", "Flusso_106", "Flusso_118", "Flusso_98", "Flusso_100", "Flusso_129", "Flusso_120", "Flusso_113", "Flusso_95", "Flusso_97", "Flusso_126", "Flusso_109", "Flusso_119", "Flusso_112"];
var devices = [["r-4001", "xv4145"], ["p-4602", "xv4235"], ["r-4001", "acquacaldaexit"], ["h2otorrestart1", "e-4505"], ["e-4502", "h20torreexit"], ["xv4602-2", "e-4505"], ["xv4236", "s4304exit"], ["hv4232", "r-4001"], ["s-4301start", "hv4232"], ["ul152", "r-4001"], ["p-4602", "xv4236"], ["xv4235", "s4305exit"], ["xv4602-2", "ul152"], ["r-4001", "xv4121"], ["r-4001", "e-4502"], ["xv4113", "r-4001"], ["ul151", "xv4107"], ["p-4606start", "r-4001"], ["xv4001d", "gasdisingaggioexit"], ["ul150", "ul154"], ["e-4505", "ul153"], ["xv4107", "xv4145"], ["s-4302start", "r-4001"], ["clorostart", "ul151"], ["e-4502", "xv4201a"], ["h20torrestart", "e-4502"], ["azotostart", "ul150"], ["p-4602", "xv4602-2"], ["e-4505", "h2otorreexit1"], ["e-4502", "xv4001d"], ["xv4201a", "abbacidoexit"], ["xv4145", "degasamentoiposodioexit"], ["ul153", "r-4001"], ["xv4121", "p-4602"], ["h20caldastart", "xv4113"]];
var elementLines = [];
var elementDevices = [];
var n = [];
var nD = [];
function highlight(className, value, display) {
    document.getElementById(className.baseVal).setAttribute("display", display);
    for(var i = 0; i <  n[className.baseVal]; i ++) {
        elementLines[className.baseVal][i].setAttribute("stroke-width", value);
    }
    for(var i = 0; i < nD[className.baseVal]; i++) {
        elementDevices[className.baseVal][i].setAttribute("stroke-width", value);
    }
}
for(var i = 0; i < lines.length; i++) {
    var currentClass = lines[i];
    elementLines[currentClass] = document.getElementsByClassName(currentClass);
    n[currentClass] = elementLines[currentClass].length;
    nD[currentClass] = devices[i].length;
    elementDevices[currentClass] = [];
    for(var j = 0; j < nD[currentClass]; j++) {
        elementDevices[currentClass][j] = document.getElementById(devices[i][j]);
    }
    for(var k = 0; k < n[currentClass]; k++) {
        elementLines[currentClass][k].onmouseover = function() {
            highlight(this.className, "7", "block");
        };
        elementLines[currentClass][k].onmouseout = function() {
            highlight(this.className, "3", "none");
        };
    }
};
